import React from 'react'
import logo from '../img/logo.png'
import './NavBar.css'
import { Link } from 'react-router-dom'

const Navbar = () => {

    const loginStatus=()=>{
        const token=localStorage.getItem('jwt')
        if(token)
        {
            return (
                <>
                 <Link to="/profile">
                <li>Profile</li>
            </Link>
            <Link to="/createPost">
                <li>Create Post</li>
            </Link>
                </>
            )

        }
    }
  return (
    <div className='navbar'>
        <img src={logo} alt="" />
        <ul className="nav-menu">
            <Link to="/signup">
                <li>Signup</li>
            </Link>
            <Link to="/signin">
                <li>Signin</li>
            </Link>


        </ul>
    </div>
  )
}

export default Navbar
